import React from "react";


const Hide = () => {
    const column = document.getElementById("column_one");
    column.style.display='';

};

const Dashbord = () => {
    return (
        <>
            <nav className="db dt-l tr w-100 border-box ph5-l bg-green">
                <button className="db dtc-l v-mid mid-gray link dim tc b--none bg-transparent tl-l" title="Home">
                    <img src="https://www.wikipedia.org/portal/wikipedia.org/assets/img/Wikipedia-logo-v2.png" className="dib w2 h2 br-100" alt="Student logo" />
                    hiii
                </button>
                <button onClick={Hide}>Hide</button>
            </nav>

            <article className="cf">
                <div className="fl w-20 bg-near-white tc" id="column_one">
                    <h1>Column One</h1>
                </div>
                <div className="fl w-80 bg-light-gray tc">
                    <h1>Column Two</h1>
                </div>
            </article>

        </>
    );
}

export default Dashbord;
